import React, { useState } from 'react';
import axios from 'axios';

const AIFinancialAnalysis = ({ expenses, savings }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const [rawResponse, setRawResponse] = useState(null); // Para depuraci칩n

  const fetchAIAnalysis = async () => {
    if (expenses.length === 0 || savings.length === 0) {
      setError('No hay suficientes datos para realizar el an치lisis.');
      return;
    }

    setIsLoading(true);
    setError(null);
    setAiInsights(null);
    setRawResponse(null);

    try {
      const response = await axios.post('http://localhost:11434/api/generate', {
        model: "llama3.2:3b-instruct-q8_0",
        prompt: `Act칰a como un analista financiero experto y proporciona un an치lisis en formato JSON.

        游뚿 **IMPORTANTE:** Responde **EXCLUSIVAMENTE** con un JSON v치lido. No uses Markdown, ni texto adicional, ni comentarios.

        游늷 **Datos de entrada:**
        - Gastos: ${JSON.stringify(expenses, null, 2)}
        - Ahorros: ${JSON.stringify(savings, null, 2)}

        游늷 **Ejemplo de respuesta correcta (estructura obligatoria):**
        {"gastosTotales": 1000, "ahorrosTotales": 200, "analisisGastos": "Resumen...", "progresoAhorros": "Texto...", "recomendaciones": ["Texto1", "Texto2"], "categoriasMayorGasto": ["Alquiler", "Comida"], "potencialAhorro": 500}

        游늷 **Si no tienes suficiente informaci칩n, responde:**
        {"error": "No hay suficiente informaci칩n para analizar."}

        Responde SOLO con JSON v치lido, sin texto adicional ni comentarios.`,
        stream: false,
      });

      if (response.status !== 200 || !response.data || !response.data.response) {
        throw new Error('Respuesta inv치lida de la API.');
      }

      let aiText = response.data.response.trim();
      console.log("Respuesta de la IA (cruda):", aiText);
      setRawResponse(aiText);

      // 游댳 Limpiar respuesta para evitar caracteres extra
      const jsonStart = aiText.indexOf('{');
      const jsonEnd = aiText.lastIndexOf('}');
      if (jsonStart === -1 || jsonEnd === -1) {
        throw new Error("La respuesta no contiene un JSON v치lido.");
      }

      const cleanJson = aiText.substring(jsonStart, jsonEnd + 1);

      // 游댳 Validaci칩n y parseo seguro del JSON
      try {
        const jsonData = JSON.parse(cleanJson);

        if (jsonData.error) {
          throw new Error(jsonData.error);
        }

        setAiInsights(jsonData);
      } catch (parseError) {
        console.error("Error al parsear JSON:", parseError);
        throw new Error("Error en el formato del JSON generado.");
      }

    } catch (error) {
      console.error("Error al obtener an치lisis de la IA:", error);
      setError(error.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div>
      <h2>An치lisis Financiero con IA</h2>
      <button onClick={fetchAIAnalysis} disabled={isLoading}>
        {isLoading ? "Analizando..." : "Obtener An치lisis"}
      </button>

      {error && <p style={{ color: 'red' }}>Error: {error}</p>}

      {rawResponse && (
        <div>
          <h3>Respuesta sin procesar:</h3>
          <pre>{rawResponse}</pre>
        </div>
      )}

      {aiInsights && (
        <div>
          <h3>Resultados del An치lisis</h3>
          <p><strong>Gastos Totales:</strong> ${aiInsights.gastosTotales}</p>
          <p><strong>Ahorros Totales:</strong> ${aiInsights.ahorrosTotales}</p>
          <p><strong>An치lisis:</strong> {aiInsights.analisisGastos}</p>
          <p><strong>Progreso en Ahorros:</strong> {aiInsights.progresoAhorros}</p>

          <h4>Recomendaciones</h4>
          <ul>
            {aiInsights.recomendaciones.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>

          <h4>Categor칤as de Mayor Gasto</h4>
          <ul>
            {aiInsights.categoriasMayorGasto.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>

          <p><strong>Potencial de Ahorro:</strong> ${aiInsights.potencialAhorro}</p>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
